import React from 'react';
import Navbar from './Navbar';


class Dashboard extends React.Component{

    constructor(props)
    {
        super(props);
        this.footerLast = this.footerLast.bind(this);
        this.render = this.render.bind(this);
    }

    footerLast() {
         return(
        <footer className="down-nav">

        <div className="col-lg-5 col-lg-offset-1 col-md-12 down-icon-items" ><i className="fa fa-slideshare left-icons"></i>
            <p className="text-center">Teams </p>
        </div>
        <div className="col-lg-5 col-lg-offset-1 col-md-12 down-icon-items" id="present-page"><i className="fa fa-tasks left-icons"></i>
            <p className="text-center">My Tasks</p>
        </div>
        <div className="col-lg-5 col-lg-offset-1 col-md-12 down-icon-items"><i className="fa fa-history left-icons"></i>
            <p className="text-center">Archives </p>
        </div>
    </footer> 
         );

        }


    render()
    {
        return(
            <div>
            <Navbar></Navbar>
            {this.footerLast()}
             </div>
        );
    }

}
export default Dashboard;
